import React from 'react'
import { Divider, Grid, MenuItem, TextField, makeStyles } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
  tradeBlock: {
    marginTop: '20px',
    borderBottom: "1px solid #d1d1d1"
  },
  untappedBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },
  byProductsBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },
  vauBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },
  buyersSellersBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },
  schemesPoliciesBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },
  productGuideBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },
  footPrintBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },
  eximDocsBlock: {
    margin: '20px 0px',
    borderBottom: "1px solid #d1d1d1"
  },

}));
function CountryProfile() {
  const classes = useStyles();
  return (
    <>
    <form onSubmit={searchFormSubmit}>
        <Grid
          container
          lg={12}
          item
          justifyContent="space-around"
          spacing={1}
        >
          <Grid lg={4} md={3} sm={12} xs={12} item>
            <TextField
              fullWidth
              select
              variant="outlined"
              margin="normal"
              label="Select State"
              style={{ backgroundColor: 'white' }}
              size="small"
              name="selectstate"
              value={selectstate}
              onChange={searchOnChange}
            >
              <MenuItem value="electricitybill">Andhra Pradesh</MenuItem>
              <MenuItem value="waterbill">Telangana</MenuItem>
              <MenuItem value="housetax">Karnataka</MenuItem>
            </TextField>
          </Grid>
          <Grid lg={4} md={3} sm={12} xs={12} item>
            <TextField
              fullWidth
              select
              variant="outlined"
              margin="normal"
              label="Select District"
              style={{ backgroundColor: 'white' }}
              size="small"
              name="selectdistrict"
              value={selectdistrict}
              onChange={searchOnChange}
            >
              <MenuItem value="electricitybill">Krishna</MenuItem>
              <MenuItem value="waterbill">Guntur</MenuItem>
              <MenuItem value="housetax">West Godavari</MenuItem>
            </TextField>
          </Grid>
        </Grid>
        <div>
          <h5>Category Selection</h5>
          <FormGroup row>
            {categoryModelOne.map((item, index) => (
              <Grid item lg={2}>
                <FormControlLabel
                  name={item.name}
                  value={item.value}
                  onChange={searchOnChange}
                  variant="outlined"
                  control={<Checkbox color="primary" />}
                  label={item.name}
                  labelPlacement="end"
                  InputLabelProps={{
                    style: {
                      fontSize: "5px"
                    }
                  }}
                />
                <i class={item.icon}></i>
              </Grid>
            ))}
          </FormGroup>
        </div>
        <Grid container justifyContent="center" style={{ marginTop: '15px' }}>
          <button className="btn btn-warning" type="submit">Search</button>
        </Grid>
      </form>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>General Information</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>Production of fresh produce</h6>
      </div>
      {/* <Divider/> */}
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>Exports to world</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>Imports to world</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>Import Tariff</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>India trade with this country</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>Import Regulation Standards</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>SPS Measures</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>Exports from India</h6>
      </div>
      <div style={{ margin: '20px 0px',borderBottom: "1px solid #d1d1d1" }}>
        <h6>Market Report</h6>
      </div>
    </>
  )
}

export default CountryProfile
